import React from 'react';

function Header (){
    return <nav class="navbar navbar-light bg-light">
             <a class="navbar-brand" href="#">
               <img src="https://img.itch.zone/aW1hZ2UvNTE5NzUvMjMwMTA3LnBuZw==/original/Zz%2BxMU.png" width="280" height="130" alt="word-scape" className="navimg" loading="lazy" />
             </a>
           </nav>
}

export default Header;
